def block_the_ip_address_from_gangnam_snuh(_request): ## 서울대 ip에 맞게 거르는 부분인 듯
    blank_html_file_name = 'blank.html'
    gangnam_snuh_c_class_ip_address_dict = {'172.18.3', '172.18.20', '172.18.38', '172.18.40', '172.18.41'}
    client_ip = get_client_ip(_request) ## 요청을 한 클라이언트의 ip 가져오기
    c_class_client_ip = re.search('([0-9]+\.[0-9]+\.[0-9]+)\.[0-9]',client_ip).group(1) ## re : Regeular Expression, group : 매치된 문자열 리턴
    if c_class_client_ip in gangnam_snuh_c_class_ip_address_dict: ## group(0) : entire, group(1) : first group ...
        return True
    else:
        return False

# Create your views here.
def index(_request):
    is_gangnam_snuh_ip_address = block_the_ip_address_from_gangnam_snuh(_request)
    index_html_file_name, blank_html_file_name = 'index.html', 'blank.html'
    count_for_page(_request, index_html_file_name)
    if is_gangnam_snuh_ip_address is True:
        return render(_request, blank_html_file_name)
    else:
        return render(_request, index_html_file_name)

def show_organization_chart(_request):
    is_gangnam_snuh_ip_address = block_the_ip_address_from_gangnam_snuh(_request)
    show_organization_chart_html_file_name, blank_html_file_name = 'show_organization_chart.html', 'blank.html'
    count_for_page(_request, show_organization_chart_html_file_name)
    if is_gangnam_snuh_ip_address is True:
        return render(_request, blank_html_file_name)
    else:
        return render(_request, show_organization_chart_html_file_name)

