def refine_database_list(_request, _raw_checked_database_list): ## 사용자의 입력을 받은 이후에 db 처리하는 부분
    checked_database_list = []

    split_raw_checked_database_list = _raw_checked_database_list.strip().split(':') ## 공백을 제거하고 :로 구분한다.
    for split_raw_checked_database_list_element in split_raw_checked_database_list: ## 여러 데이터가 들어올 수도 있기 때문
        regex_search_result_checked_database_list = re.search("^(\d+).*", split_raw_checked_database_list_element)
        if regex_search_result_checked_database_list is not None: ## 없는 데이터가 아니라면
            checked_database_list.append(regex_search_result_checked_database_list.group(1)) ## 첫번째 인자를 database_list에 저장함

    return checked_database_list

