def get_rest_databases_names(_current_database ,_checked_database_list, _genometrax_ontology_dict):
    _checked_database_list.remove(_current_database) ## 모든 목록에서 현재 목록만을 제거(나머지 데이터베이스 목록 추출)
    checked_database_list_with_name = []
    for checked_database_list_element in _checked_database_list:
        checked_database_list_with_name.append([checked_database_list_element, _genometrax_ontology_dict[checked_database_list_element]])
    return checked_database_list_with_name

