def search_genometrax(_request, _search_option, _hg_version, _raw_input_text, _current_database, _filterOn): ### search_genometrax
#def search_genometrax(_request, _search_option, _hg_version, _raw_input_text, _current_database): ### search_genometrax
    random_id = random.randint(1,100000000) ## 시작, 끝 수 포함하여 랜덤
    search_option = _search_option

    genometrax_feature_result_object_data_list, genometrax_feature_result_data_list, genometrax_feature_result_json_data, error_result_list,  = [], [], [], [100,[],[]]
    error_code = 100 ## 100이면 정상
    page_number = 0

    input_text_list = get_input_text_list(_raw_input_text) # 개행문자나 캐리지 리턴으로 텍스트 분할

    if search_option == 'coordinates':
        for input_text_line in input_text_list:

            error_result_list, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string = check_chromosome_position(input_text_line, error_result_list)
            print("search : "+str(error_result_list[0]))
            if(error_result_list[0] == 100): ## 100이면 정상인 것

                try: ##send_query_to_database_by_coordinate = {"hg18" : send_query_by_coordinate_in_hg18, "hg19" : send_query_by_coordinate_in_hg19, "hg38" : send_query_by_coordinate_in_hg38,}
                    genometrax_feature_result_object_data_list = send_query_to_database_by_coordinate[_hg_version](chr_number_string, user_start_int, user_end_int)
                except: ## def send_query_by_coordinate_in_hg18(_chr_number_string, _user_start_int, _user_end_int):
                        ## return split_query_by_coordinate_in_hg18[_chr_number_string](_user_start_int, _user_end_int) ## 1~Y까지 고유 이름이 정해짐(아마 테이블?)
                    print("[ Search out of region ]") ## 없을 경우 에러 발생
                genometrax_feature_result_data_list += filter_database_with_coordinates[_current_database](genometrax_feature_result_object_data_list, _current_database, hgvs_string, gene_name_string)

    elif search_option == 'genes': ## option에 따라 진행되는 내용이 다름
        for input_text_line in input_text_list:
            genometrax_feature_result_object_data_list = send_query_to_database_by_gene[_hg_version](input_text_line)
            genometrax_feature_result_data_list += filter_database_with_gene_names[_current_database](genometrax_feature_result_object_data_list, _current_database)

    else:
        print("Unexpected Error at search_genometrax()")

    _request.session['random_id'] = random_id
    GlobalManager.set_result_data_list(random_id, genometrax_feature_result_data_list)
    GlobalManager.set_current_page_number(random_id, page_number) # 0으로 단순 초기화 하는 듯, 특별히 작업하는 곳이 없음
    #if len(genometrax_feature_result_data_list) is not 0:
    if((len(genometrax_feature_result_data_list) is not 0) and _filterOn=="nonFilter"): # 데이터가 존재하고 nonFilter일때
        GlobalManager.set_total_page_number(random_id, (len(genometrax_feature_result_data_list)-1)//35) ## //의 의미는 integer division, 소수로 나오지 않음
    else: #filterOn이 true이거나, data_list에 아무것도 없을 때
        GlobalManager.set_total_page_number(random_id, 0) # 페이지 넘버 설정

    if(len(genometrax_feature_result_data_list)>=35): ## 35개 이상일 경우 json 파일 변환
        #filterOn에 따른 분기 실시
        if(_filterOn=="filter"):
            genometrax_feature_result_json_data = json.dumps(genometrax_feature_result_data_list, ensure_ascii=False)
        else:
            genometrax_feature_result_json_data = json.dumps(genometrax_feature_result_data_list[0:35], ensure_ascii=False)
    else:
        genometrax_feature_result_json_data = json.dumps(genometrax_feature_result_data_list, ensure_ascii=False)

    return genometrax_feature_result_json_data, error_result_list

