def is_tcga_png_files_existed(_tumor_name_text, _tcga_input_text, _PATHOSTAGE_STRING_LIST, _STATISTIC_STRING_LIST):
    TCGA_RELATIVE_PATH = '/cbi_webpage/static/tcgaData/'
    SLASH_STRING, UNDERBAR_STRING, DOT_STRING, OS_STRING, OUTPUT_PNG_STRING = '/', '_', '.', 'OS', 'output.png'
    target_tumor_directory = os.getcwd() + TCGA_RELATIVE_PATH + _tumor_name_text + UNDERBAR_STRING + _PATHOSTAGE_STRING_LIST[0] + UNDERBAR_STRING + _STATISTIC_STRING_LIST[0] + SLASH_STRING
    target_file_name = _tumor_name_text + DOT_STRING + _tcga_input_text + DOT_STRING + OS_STRING + DOT_STRING + _PATHOSTAGE_STRING_LIST[0] + DOT_STRING + _STATISTIC_STRING_LIST[0] + UNDERBAR_STRING + OUTPUT_PNG_STRING
    target_file_full_path = target_tumor_directory + target_file_name
    return os.path.exists(target_file_full_path)

def get_input_text_list(_raw_input_text):
    if '\r\n' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\r\n')
    elif '\n' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\n')
    elif '\r' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\r')
    else:
        input_text_list = [_raw_input_text]

    return input_text_list

def filter_database_by_six_with_coordinates(_genometrax_feature_result_object_data_list, _current_database, _hgvs_string, _gene_name_string):
    genometrax_feature_result_data_list = []
    genometrax_feature_result_object_data_list_length = len(_genometrax_feature_result_object_data_list)

    if genometrax_feature_result_object_data_list_length == 1:
        genometrax_feature_result_object_data = _genometrax_feature_result_object_data_list[0]
        genometrax_feature_first_filtered_object_data = genometrax_feature_result_object_data.filter(ngs_ontology_no=int(_current_database))
        genometrax_feature_second_filtered_object_data = genometrax_feature_first_filtered_object_data.filter(description__regex=r"nucleotideChange.+"+_hgvs_string+";")
        genometrax_feature_third_filtered_object_data = genometrax_feature_second_filtered_object_data.filter(description__contains=_gene_name_string+";")
        genometrax_feature_result_data_list += refine_genometrax_object_data(genometrax_feature_third_filtered_object_data)
