        genometrax_feature_second_filtered_first_object_data = genometrax_feature_first_filtered_first_result_object_data.filter(description__regex=r"nucleotideChange.+"+_hgvs_string+".+;")
        genometrax_feature_third_filtered_first_object_data = genometrax_feature_second_filtered_first_object_data.filter(description__contains=_gene_name_string+";")

        genometrax_feature_first_filtered_second_result_object_data = genometrax_feature_second_result_object_data.filter(ngs_ontology_no=int(_current_database))
        genometrax_feature_second_filtered_second_object_data = genometrax_feature_first_filtered_second_result_object_data.filter(description__regex=r"nucleotideChange.+"+_hgvs_string+".+;")
