def check_chromosome_position(_input_text_line, _error_result_list):
    error_code, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string, strand_string = 100, "", "", 0, 0, "", "", ""

    print("==============================================")
    print("input text_line : "+_input_text_line)
    split_input_text_line_list = _input_text_line.split(' ') ## coordinate일 때, 스페이스바로 구분하여 입력받음
    genomic_coordinate_string, hgvs_string, gene_name_string = check_split_input_text_line_list(split_input_text_line_list) # 스페이스로 구분된 정보를 보냄
    genomic_coordinate_string = genomic_coordinate_string.replace(",","") ## 쉼표를 없는 것으로 치환

    print("==============================================")
    print("genomic_coordinate_string : "+ genomic_coordinate_string)
    print("--------------------------")

    ## 정규식 예외처리구문 추가
    #print("hgvs : "+hgvs_string)

    try:
        regex_search_result = re.search('(chr)([1-9]|1[0-9]|2[0-9]|[XYM]):(\d+)-(\d+)', genomic_coordinate_string) ## chr1~29, chrXYM그리고 숫자-숫자로 이루어졌는지 검사

        chr_string = regex_search_result.group(1) ## search 이후 match 객체 리턴(값이 없을 시 None 객체 리턴) 여기서는 chr 문자열
        chr_number_string = regex_search_result.group(2) ## 여기는 chr 이후 숫자나 문자관련
        user_start_int = int(regex_search_result.group(3)) ## start 범위이다. (start-end)에서 start에 해당함
        user_end_int = int(regex_search_result.group(4)) ## end 범위이다.  (start-end)에서 end에 해당함


        print("end-start : "+str(user_end_int - user_start_int))

        if user_start_int > user_end_int: ## 범위지정이 잘 못되었을때(시작범위 > 끝범위)
            _error_result_list[0] = 102
            _error_result_list[1].append(chr_string+chr_number_string+":"+str(user_start_int)+"-"+str(user_end_int))
        elif user_end_int - user_start_int >= 1000000: ## 끝-시작이 10^6이상일때
            _error_result_list[0] = 103
            _error_result_list[2].append(chr_string+chr_number_string+":"+str(user_start_int)+"-"+str(user_end_int))
        else:
            _error_result_list[0] = 100 ## 범위상에서 에러가 없다면 정상

        print(_error_result_list[0])
        return _error_result_list, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string

    except: # Catch All Condition
        print("Regex Error. views.py 1135 lines") #임의의 데이터로 넘긴다.
        _error_result_list[0] = 106 # 106은 정규식 에러로
        return _error_result_list, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string


def check_split_input_text_line_list(_split_input_text_line_list):
    genomic_coordinate_string, hgvs_string, gene_name_string = _split_input_text_line_list[0], "", ""
    #print("=======================")
    #print("len(_split_input_text_line_list) : "+str(len(_split_input_text_line_list)))

    if len(_split_input_text_line_list)==1:
        print("[ There is no any hgvs and gene name ]")
    elif len(_split_input_text_line_list)==2:
        if is_hgvs_string(_split_input_text_line_list[1]):
            hgvs_string = _split_input_text_line_list[1]
        elif is_gene_name_string(_split_input_text_line_list[1]):
            gene_name_string = _split_input_text_line_list[1]
        else:
            print("The second input is not hgvs and gene name type >> ", _split_input_text_line_list[1])
    elif len(_split_input_text_line_list)==3:
        if is_hgvs_string(_split_input_text_line_list[1]):
            hgvs_string = _split_input_text_line_list[1]
        elif is_gene_name_string(_split_input_text_line_list[1]):
            gene_name_string = _split_input_text_line_list[1]
        else:
            print("The second input are not hgvs and gene name type >> ", _split_input_text_line_list[1])

        if is_hgvs_string(_split_input_text_line_list[2]):
            if hgvs_string == "":
                hgvs_string = _split_input_text_line_list[2]
        elif is_gene_name_string(_split_input_text_line_list[2]):
            if gene_name_string == "":
                gene_name_string = _split_input_text_line_list[2]
        else:
            print("The input order is reversed >> ", _split_input_text_line_list[2])
                #print("=======================")
                #print("len(_split_input_text_line_list) : "+str(len(_split_input_text_line_list)))
        #print(genomic_coordinate_string,"===" ,hgvs_string, "===",gene_name_string)
        #값은 리턴 잘 됨
    else:
        print("Unexpected Error at check_split_input_text_line_list() >>", len(_split_input_text_line_list))
    return genomic_coordinate_string, hgvs_string, gene_name_string

def is_hgvs_string(_input_string): ## hgvs를 나타내는 문자열이 포함되어 있다면 True 아니면 False
    hgvs_string_list = [">", "del", "dup", "ins", "inv", "con"]

    for hgvs_string in hgvs_string_list:
        if hgvs_string in _input_string:
            return True
    return False

def is_gene_name_string(_input_string):
    regex_search_result = re.search('([A-Z\d]+)', _input_string)
    if len(_input_string) == len(regex_search_result.group(1)):
        return True
    elif "orf" in _input_string:
        return True
    return False

def refine_genometrax_object_data(_genometrax_feature_filtered_object_data):
    temp_list, genometrax_feature_refined_data_list = [], []
    for _genometrax_feature_filtered_object_data_element in reversed(_genometrax_feature_filtered_object_data):
        if _genometrax_feature_filtered_object_data_element['accession'] not in temp_list:
            temp_list.append(_genometrax_feature_filtered_object_data_element['accession'])
            genometrax_feature_refined_data_list.append(_genometrax_feature_filtered_object_data_element)

    return genometrax_feature_refined_data_list[::-1]

def export_xlsx(_request, _downloadStatus, _current_database, _random_id):
    raw_hg_version_text = _request.session['raw_hg_version_text']
    input_text_list = get_input_text_list(GlobalManager.get_raw_input_text(_random_id))
    search_option = GlobalManager.get_search_option(_random_id)
    genometrax_ontology_result_json_data = _request.session['genometrax_ontology_result_json_data']
    genometrax_ontology_dict = json.loads(genometrax_ontology_result_json_data)
    error_result_list = [100]

    response = HttpResponse(content_type='application/vnd.openxmlformats-officedocument.spreadsheetml.sheet')
    response['Content-Disposition'] = 'attachment; filename=Genometrax_Search_Results.xlsx'
    workbook = xlsxwriter.Workbook(response, {'in_memory': True})

    if _downloadStatus == 'all':

        checked_database_list = _request.session['checked_database_list']

        for checked_database_list_element in checked_database_list:
            genometrax_feature_result_data_list = []
            for input_text_line in input_text_list:

                if search_option == 'coordinates':
                    error_result_list, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string, strand_string = check_chromosome_position(input_text_line, error_result_list)
                    genometrax_feature_result_object_data_list = send_query_to_database_by_coordinate[raw_hg_version_text](chr_number_string, user_start_int, user_end_int)
                    genometrax_feature_result_data_list += filter_database_with_coordinates[checked_database_list_element](genometrax_feature_result_object_data_list, checked_database_list_element, hgvs_string, gene_name_string)
                elif search_option == 'genes':
                    genometrax_feature_result_object_data_list = send_query_to_database_by_gene[raw_hg_version_text](input_text_line)
                    genometrax_feature_result_data_list += filter_database_with_gene_names[checked_database_list_element](genometrax_feature_result_object_data_list, checked_database_list_element)

            row_num = 0
            worksheet = workbook.add_worksheet(NgsOntology.objects.get(pk=checked_database_list_element).ucsc_track)
            columns = get_columns_by_database[checked_database_list_element]()

            format = workbook.add_format()

            for col_num in range(len(columns)):
                worksheet.set_column(col_num, col_num, columns[col_num][1])
                worksheet.write_string(row_num, col_num, columns[col_num][0], format)

            for genometrax_feature_result_dictionary_data in genometrax_feature_result_data_list:

                row_num += 1
                rows = get_rows_by_database[checked_database_list_element](genometrax_ontology_dict, checked_database_list_element, genometrax_feature_result_dictionary_data)

                for col_num in range(len(rows)):
                    worksheet.write_string(row_num, col_num, str(rows[col_num]), format)

    elif _downloadStatus == 'current':

        current_database = _current_database

        genometrax_feature_result_data_list = []
        for input_text_line in input_text_list:

            if search_option == 'coordinates':
                error_result_list, chr_string, chr_number_string, user_start_int, user_end_int, hgvs_string, gene_name_string = check_chromosome_position(input_text_line, error_result_list)
                genometrax_feature_result_object_data_list = send_query_to_database_by_coordinate[raw_hg_version_text](chr_number_string, user_start_int, user_end_int)
                genometrax_feature_result_data_list += filter_database_with_coordinates[current_database](genometrax_feature_result_object_data_list, current_database, hgvs_string, gene_name_string)
            elif search_option == 'genes':
                genometrax_feature_result_object_data_list = send_query_to_database_by_gene[raw_hg_version_text](input_text_line)
                genometrax_feature_result_data_list += filter_database_with_gene_names[current_database](genometrax_feature_result_object_data_list, current_database)


        row_num = 0
        worksheet = workbook.add_worksheet(NgsOntology.objects.get(pk=current_database).ucsc_track)
        columns = get_columns_by_database[current_database]()

        format = workbook.add_format()

        for col_num in range(len(columns)):
            worksheet.set_column(col_num, col_num, columns[col_num][1])
            worksheet.write_string(row_num, col_num, columns[col_num][0], format)

        for genometrax_feature_result_dictionary_data in genometrax_feature_result_data_list:

            row_num += 1
            rows = get_rows_by_database[current_database](genometrax_ontology_dict, current_database, genometrax_feature_result_dictionary_data)

            for col_num in range(len(rows)):
                worksheet.write_string(row_num, col_num, str(rows[col_num]), format)

    return response

