def change_arguments_into_url(_target, _link_type):
    temp_string = ""
    pubmed_basic_url = "http://www.ncbi.nlm.nih.gov/pubmed/?term="
    uniprot_basic_url = "http://www.uniprot.org/uniprot/"

    if _target == "N/A":
        return _target
    else:
        split_target = _target.split(",")

        if _link_type == "pmid_link":
            for split_target_element in split_target:
                temp_string += pubmed_basic_url + split_target_element + ", "
        elif _link_type == "uniprot_link":
            for split_target_element in split_target:
                temp_string += uniprot_basic_url + split_target_element + ", "
        return temp_string[:len(temp_string)-2]

def get_description_element(_regex, _target):
    description_element = re.search(_regex, _target)
    return urllib2.unquote(description_element.group(1))

def search_kegg(_raw_input_text):
    dic_kegg=cbi_webpage.kegg_util.kegg_idconverter('hsa')
    dic_pathway_name=cbi_webpage.kegg_util.kegg_pathway_name('hsa')
    dic_g2p,dic_p2g=cbi_webpage.kegg_util.kegg_load('hsa')
    dic_pgc={}

    if '\r\n' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\r\n')
    elif '\n' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\n')
    elif '\r' in _raw_input_text:
        input_text_list = _raw_input_text.strip().split('\r')
    else:
        input_text_list = [_raw_input_text]

    no_gene_name_list = []
    no_pathway_name_list = []
    result_list = []
    error_result_list = []
    gene_count = 0;

    for line in input_text_list:
        if ' ' in line:
            split_line=line.strip().split(' ')
        elif '\t' in line:
            split_line=line.strip().split('\t')
        else:
            split_line=[line]

        gene_name, background_color, foreground_color, error_code = set_mapping_variable(split_line)

        if(not background_color.isupper() and error_code == 208):
            error_code = 208
            error_result_list = [error_code, no_gene_name_list, no_pathway_name_list];
            return result_list, error_result_list
        elif(background_color.isupper() and error_code != 208):
            error_code = 209
            error_result_list = [error_code, no_gene_name_list, no_pathway_name_list];
            return result_list, error_result_list
        elif(background_color.isupper() and error_code == 208):
            error_code = 210
            error_result_list = [error_code, no_gene_name_list, no_pathway_name_list];
            return result_list, error_result_list

        gene_count+=1;
        if not gene_name in dic_kegg:
            no_gene_name_list.append(gene_name)
            continue
        ids = dic_kegg[gene_name]
        for id in ids:
            if not id in dic_g2p:
                no_pathway_name_list.append(gene_name)
                continue
            for p in dic_g2p[id]:
                if not p in dic_pgc: dic_pgc[p]={}
                dic_pgc[p][id]=[background_color,foreground_color]

    if gene_count == len(no_gene_name_list):
        error_code = 201;
    elif gene_count != len(no_gene_name_list):
        if(len(no_gene_name_list)!=0):
            if (gene_count - len(no_gene_name_list)) == len(no_pathway_name_list):
                error_code = 202
            elif (gene_count - len(no_gene_name_list)) != len(no_pathway_name_list):
                if len(no_pathway_name_list) != 0:
                    error_code = 203
                elif len(no_pathway_name_list) == 0:
                    error_code = 204
        elif(len(no_gene_name_list)==0):
            if (gene_count - len(no_gene_name_list)) == len(no_pathway_name_list):
                error_code = 205
            elif (gene_count - len(no_gene_name_list)) != len(no_pathway_name_list):
                if len(no_pathway_name_list) != 0:
                    error_code = 206
                elif len(no_pathway_name_list) == 0:
                    error_code = 207

    pathway_count = 0
    for num, p in enumerate(sorted(dic_pathway_name.keys())):
        if not p in dic_pgc:
            pass
        else:
            gene_info=[]
            if len(dic_pgc[p].items()) >= 3:
                for g,c in dic_pgc[p].items():
                    gene_info.append([g,c])
                result_list.append(cbi_webpage.kegg_util.mapping(p,gene_info))
            elif len(dic_pgc[p].items()) < 3:
                pathway_count+=1
                pass

    if len(dic_pgc) == pathway_count:
        error_code = 212

    result_list.sort(key=lambda x: x[0], reverse=True)
    error_result_list = [error_code, no_gene_name_list, no_pathway_name_list];

    return result_list, error_result_list


def set_mapping_variable(_split_line):
    error_code = 0;

    if len(_split_line) == 1:
        gene_name=_split_line[0]
        background_color="#f7bac5"
        foreground_color="#000000"
    elif len(_split_line) == 2:
        gene_name=_split_line[0]
        background_color=_split_line[1]
        foreground_color="#000000"
    # elif len(_split_line) == 3:
    #     gene_name=_split_line[0]
    #     background_color=_split_line[1]
    #     foreground_color=_split_line[2]
    elif len(_split_line) > 2:
        gene_name=_split_line[0]
        background_color=_split_line[1]
