def show_igv(_request):
    dbx = dropbox.Dropbox('LhdhT1pcZ1UAAAAAAAAdvuWJi-_rqkdhx9hRZpCA_djy9ZbMFi9kGiH6jYWwkdSR')

    time_stamp = time.time()
    temporary_folder_name = datetime.datetime.fromtimestamp(time_stamp).strftime('%Y%m%d_%H%M%S%f')
    share_file_url_list = []
    igv_input_file_main_dictionary = OrderedDict()

    if _request.method == 'POST':
        for folder_meta_data in dbx.files_list_folder('').entries:
            dbx.files_delete(folder_meta_data.path_lower)

        dbx.files_create_folder("/"+str(temporary_folder_name))

        for index, file in enumerate(_request.FILES.getlist('myfiles')):
            post_data = {"name" : file.name, "index" : index, "total_length" : len(_request.FILES.getlist('myfiles'))}
            data=urllib.parse.urlencode(post_data)
            result = urllib2.urlopen('http://localhost:8080/update_uploading_info/', data.encode())

            targeted_upload_uri = "/" + temporary_folder_name + "/" + str(file.name)
            dbx.files_upload(file, targeted_upload_uri)
            share_link = dbx.sharing_create_shared_link(targeted_upload_uri)
            partial_share_link_url = re.search('(/s.*)\?dl=0', share_link.url)
            full_share_link_url = "https://dl.dropboxusercontent.com" + partial_share_link_url.group(1)
            share_file_url_list.append([str(file.name), full_share_link_url])

            searched_file_name_object = re.search('(.*)\.(chr.*)_([0-9]+)_([0-9]+)\.bam.*', file.name)

            if(searched_file_name_object is not None):
                search_type = 0
            elif(searched_file_name_object is None):
                search_type = 1
                searched_file_name_object = re.search('(.*)\.([A-Za-z0-9]+)\.bam.*', file.name)

            file_extension = str(file.name)[len(str(file.name))-3:len(str(file.name))]
            if file_extension == "bam":
                if(search_type == 0):
                    locus = searched_file_name_object.group(2) + ":" + searched_file_name_object.group(3) + "-" + searched_file_name_object.group(4)
                elif(search_type == 1):
                    locus = searched_file_name_object.group(2)

                if not locus in igv_input_file_main_dictionary:
                    igv_input_file_main_dictionary[locus] = OrderedDict()
                igv_input_file_main_dictionary[locus][searched_file_name_object.group(1)] = [full_share_link_url]
            elif file_extension == "bai":
                igv_input_file_main_dictionary[locus][searched_file_name_object.group(1)].append(full_share_link_url)
            else:
                print("Unexpected File Type")


        _request.session['global_share_file_url_list'] = igv_input_file_main_dictionary
        return render(_request, 'show_igv_result.html', {'igv_input_file_main_dictionary': igv_input_file_main_dictionary})
    else:
        return render(_request, 'show_igv.html')

def show_igv_browser(_request, key):

    igv_input_file_main_dictionary = _request.session['global_share_file_url_list']
    igv_input_file_sub_dictionary = igv_input_file_main_dictionary[key]
    sorted_igv_input_file_sub_dictionary = OrderedDict(sorted(igv_input_file_sub_dictionary.items()))

    return render(_request, 'show_igv_browser.html', {'key': key,'igv_input_file_sub_dictionary': sorted_igv_input_file_sub_dictionary})

